    <div className="head container">

   
    <img src='https://mir-s3-cdn-cf.behance.net/projects/404/2971a3169377049.Y3JvcCwxMDgwLDg0NCwwLDExNw.png' style={{width:"190px",height:"160px"}} onClick={()=>{navigate("/")}} />
   

     <ul className="list">
       <li><a href="/login">Login</a></li>
       <li><a href="/signup">SignUp</a></li>
     </ul>
     </div>
   }

    
    <p color='red'>Please Login to view your cart</p>}
    
    </>
  )
}

